import React from "react";
import {useDispatch} from 'react-redux'
import {useShowNavigationItems} from '../store/actions/actionsIndex'

const App = () => {
  return (
    <div style={{height: 1000, width: '100%', backgroundColor: 'red'}}>
      <button onClick={useDispatch(useShowNavigationItems)}>Testing</button>
    </div>
  );
};



export default App;
